import { FunctionComponent, useState } from "react";
import { Container, EmailSideBar, EmailInbox, EmailContainer, EmailInput, EmailTextBox } from "./styles/styled";
import { IContactPageProps } from "./types/types";

const ContactPage: FunctionComponent<IContactPageProps> = ({ themeState }) => {
  const [to, setTo] = useState<string>("To: Russell");
  const [from, setFrom] = useState<string>("");
  const [subject, setSubject] = useState<string>("");
  const [message, setMessage] = useState<string>("");

  return (
    <Container themeState={themeState}>
      <EmailSideBar themeState={themeState} />
      <EmailInbox themeState={themeState} />
      <EmailContainer themeState={themeState}>
        <EmailInput value={to} />
        <EmailInput value={from} placeholder={"From: "} />
        <EmailInput value={subject} placeholder={"Add subject"} />
        <EmailTextBox value={message} />
      </EmailContainer>
    </Container>
  );
};

export default ContactPage;
